import React from "react";
import periodicTables from "./periodicTables.png";
import weLoveMovies from "./weLoveMovies.png";

function Projects() {
  return (
    <div className="breathe">
      <h2 id="projects" style={{ marginBottom: "50px", marginTop: "180px" }}>
        My Babies
      </h2>
      <div className="row">
        <div className="column3">
          <div className="polaroid">
            <div className="container2">
              <img
                style={{
                  width: "100%",
                  borderRadius: "5px",
                  maxHeight: "250px",
                }}
                src={periodicTables}
              />
              <div className="overlay">
                <div className="text">
                  <h4>PeriodicTables</h4>
                  <p>"A restaurant reservation system"</p>
                  <p>React, CSS, Express, Knex, PostgreSQL.</p>
                </div>
              </div>
            </div>
            <div className="container">
              <a
                href={`https://github.com/GiupiDeLuca/Periodic-Tables`}
                target="_blank"
              >
                <p>GitHub Repo</p>
              </a>
            </div>
          </div>

          <div className="polaroid">
            <div className="container2">
              <img
                style={{
                  width: "100%",
                  borderRadius: "5px",
                  maxHeight: "250px",
                }}
                src={weLoveMovies}
              />
              <div className="overlay">
                <div className="text">
                  <h4>WeLoveMovies</h4>
                  <p>"Find Your Favorite Movie"</p>
                  <p>Node, Express, Knex, PostgreSQL, HTTP </p>
                </div>
              </div>
            </div>
            <div className="container">
              <a
                href={`https://github.com/GiupiDeLuca/BackEnd-Capstone-WeLoveMovies`}
                target="_blank"
              >
                <p>GitHub Repo</p>
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Projects;

